import React, { useEffect, useState } from 'react'
import profile from '../assets/female_doctor.webp'

const Profile = (props) => {

    const userid = props.userID.userID;
    console.log('userid for backend from proifle', userid);
    const [data, setData] = useState([]);
    const url = `http://localhost:5050/auth/userdata?data=${encodeURIComponent(userid)}`;

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await fetch(url); // Replace with your API endpoint
                if (!response.ok) {
                    throw new Error('Failed to fetch user data');
                }
                const data = await response.json();
                setData(data.user);
            } catch (error) {
                console.log(error);
            }
        };

        fetchData();
    }, [url]);

    console.log('data from profile',data);
    return (
        <div className='d-flex justify-content-center align-items-center mx-auto  m-3 '>
            <div className='d-flex border border-primary justify-content-center align-items-center  flex-column ' style={{ width: '98%', height: '70vh' }}>
                <div >
                    <img src={profile} alt="" style={{ width: '5rem', borderRadius: '50%' }} />
                </div>
                <div>
                    <div className="d-flex flex-column" style={{ width: '20vw' }}>
                        <label htmlFor="time">First Name</label>
                        <input
                            type="text"
                            id="time"
                            className="p-1"
                            value={''}
                            readOnly
                        />
                    </div>
                    <div className="d-flex flex-column " style={{ width: '20vw' }} >
                        <label htmlFor="time">Last Name</label>
                        <input
                            type="text"
                            id="time"
                            className="p-1"
                            value={''}
                            readOnly
                        />
                    </div>
                    <div className="d-flex flex-column " style={{ width: '20vw' }}>
                        <label htmlFor="time">Email</label>
                        <input
                            type="text"
                            id="time"
                            className="p-1"
                            value={''}
                            readOnly
                        />
                    </div>

                </div>
            </div>
        </div>
    )
}

export default Profile
